Run a specific $match query only if string is not empty<p>I am trying to implement a search of documents in a collection.  One of the queries in the $match stage checks if anything in a list matches another list from my JS (not within the document).</p>
<p>However, what I want to do is only run that query if the list has contents.  If it is empty then just ignore it.</p>
<p>Essentially like choosing options in a filter.  If you choose something, then it will search for that, if you choose nothing then it doesn't limit based on that.</p>
<p>Person documents:</p>
<pre><code>{
    name: String,
    dob: Date,
    gender: String,
    favoriteColors: [{
        color: String,
        otherInfo: String
    }]
}
</code></pre>
<p>My pipeline:</p>
<pre><code>let colors = [&quot;red&quot;, &quot;blue&quot;, &quot;green&quot;];

collection.aggregate([
    {$match: {
        gender: &quot;male&quot;,
        //run below only if colors array is not empty
        favoriteColors: {
            $elemMatch: {
                color: {
                    $in: colors
                }
            }
        }
    }}
])
</code></pre>
<p>How can I basically just run that part of the aggregate only if the array is not empty?  I really don't want to use an if statement and write that same aggregate twice based on the two different conditions.  Is it even possible to do this?</p>

